import React from 'react';
import "react-phone-number-input/style.css";
import PhoneInput from "react-phone-number-input";
import s from './CheckList.module.css'

const CheckList = (props) => {
    const [value, setValue] = useState();
    return (
      <div className={s.wrapper}>
        {props.content} <br />
        <form action="POST" className={s.form}>
          <label className={s.tel__wrapper}>
            Введите номер телефона <br />
            <PhoneInput
              type="tel"
              className={s.tel}
              placeholder="Телефон"
              required
              value={value}
              onChange={setValue}
            />
          </label>
          <label className={s.sum__wrapper}>
            <br />
            Введите сумму (1-1000 руб)
            <br />
            <input
              type="number"
              className={s.sum}
              placeholder="Сумма"
              required
              min="1"
              max="1000"
            />
          </label>
          <br />
          <button type="submit" className={s.btn}>
            Оплатить
          </button>
        </form>
      </div>
    );
        }
export default CheckList;
